import styled from 'styled-components';

export const Container = styled.div`
  height: 398px;
  background: #e5e5e5;
  .contact {
    font-weight: 600;
    font-size: 28px;
    line-height: 42px;
    color: #000000;
  }
`;

export const Inputs = styled.div`
  display: flex;
  align-items: center;
  flex-direction: column;

  p {
    font-size: 12px;
  }

  input {
    background-color: #f5f5f7;
    margin: 0.5em;
  }
`;
